import '../styles/Filter.css'
const Filter = ()=>{
    return(
        <div>
            <button className="button-filter">Top</button>
            <button className="button-filter">Popular</button>
            <button className="button-filter">Recommended</button>
            <button className="button-filter">Filter</button>
        </div>
    )
}
export default Filter
